data:
  definition: rapport, généralement exprimé en décibels, de la puissance apparente
    en un point déterminé d'une voie perturbatrice à la puissance apparente, due à
    la diaphonie provenant de cette voie, en un point déterminé de la voie perturbée,
    dans des conditions spécifiées de terminaison de ces voies
